        if (Inputs.var_tapeendpartnum.Value != "")
        {
            available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_tapeendpartnum.Value, out PartWeight);
        }
        if (available_part) {
            CompWeight9 = PartWeight * Inputs.var_tapeendqty.Value;
        }

        if (Inputs.var_topcappartnum.Value != "")
        {
            available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_topcappartnum.Value, out PartWeight);
        }
        if (available_part) {
            CompWeight10 = PartWeight * Inputs.var_topcapqty.Value;
        }

        if (Inputs.var_wallclippartnum.Value != "")
        {
            available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_wallclippartnum.Value, out PartWeight);
        }
        if (available_part) {
            CompWeight11 = PartWeight * Inputs.var_wallclipqty.Value;
        }

        if (Inputs.var_addpart1.Value != "")
        {
            available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_addpart1.Value, out PartWeight);
        }
        if (available_part) {
            CompWeight12 = PartWeight * Inputs.var_addqty1.Value;
        }
        if (Inputs.var_addpart2.Value != "")
        {
            available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_addpart2.Value, out PartWeight);
        }
        if (available_part) {
            CompWeight13 = PartWeight * Inputs.var_addqty2.Value;
        }

        if (Inputs.var_addpart3.Value != "")
        {
            available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_addpart3.Value, out PartWeight);
        }
        if (available_part) {
            CompWeight14 = PartWeight * Inputs.var_addqty3.Value;
        }

        if (Inputs.var_screwpart1.Value != "")
        {
            available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_screwpart1.Value, out PartWeight);
        }
        if (available_part) {
            CompWeight15 = PartWeight * Inputs.var_screw1qty.Value;
        }

        if (Inputs.var_addpackpart.Value != "")
        {
            available_part = UDMethods.GetPartWeight(Context.CompanyID, Inputs.var_addpackpart.Value, out PartWeight);
        }
        if (available_part) {
            CompWeight16 = PartWeight * Inputs.var_addpackqty.Value;
        }


        /* Totals the individual component weights */
        decimal interimweightcalc = 0m;

        interimweightcalc = CompWeight1 + CompWeight2 + CompWeight3 + CompWeight4 + CompWeight5 + CompWeight6 + CompWeight7 + CompWeight8 + CompWeight9 + CompWeight10 + CompWeight11 + CompWeight12 + CompWeight13 + CompWeight14 + CompWeight15 + CompWeight16;

        if ((interimweightcalc > 0.01m) && (Inputs.var_reldefault.Value != "pick"))
        {
            Inputs.var_netweight.Value = interimweightcalc;
            /* Used to display Netweight list incase verification is required */
            Inputs.var_weightlookup.Value = "1(" + CompWeight1.ToString() + ")" + " - 2(" + CompWeight2.ToString() + ")" + " - 3(" + CompWeight3.ToString() + ")" + " - 4(" + CompWeight4.ToString() + ")" + " - 5(" + CompWeight5.ToString() + ")" + " - 6(" + CompWeight6.ToString() + ")" + " - 7(" + CompWeight7.ToString() + ")" + " - 8(" + CompWeight8.ToString() + ")" + " - 9(" + CompWeight9.ToString() + ")" + " - 10(" + CompWeight10.ToString() + ")" + " - 11(" + CompWeight11.ToString() + ")" + " - 12(" + CompWeight12.ToString() + ")" + " - 13(" + CompWeight13.ToString() + ")" + " - 14(" + CompWeight14.ToString() + ")" + " - 15(" + CompWeight15.ToString() + ")" + " - 16(" + CompWeight16.ToString() + ")";
        }

        /* Sets a default value to prevent Intrastat Issues */
        if ((interimweightcalc > 0.01m) && (Inputs.var_reldefault.Value == "pick"))
        {
            string defaultintrastatvalue = "";
            defaultintrastatvalue = PCLookUp.DataLookup("TENUK_FG_MasterTable", "intrastat_unitweightkg", Inputs.var_fgnum.Value);
            if (defaultintrastatvalue != "") { Inputs.var_netweight.Value = UDMethods.ConvertToDecimal((defaultintrastatvalue)); }
            if (defaultintrastatvalue == "") { Inputs.var_netweight.Value = 1; }
        }


        /* Sets a default value to prevent Intrastat Issues */
        if (interimweightcalc == 0.00m)
        {
            string defaultintrastatvalue1 = "";
            defaultintrastatvalue1 = PCLookUp.DataLookup("TENUK_FG_MasterTable", "intrastat_unitweightkg", Inputs.var_fgnum.Value);
            if (defaultintrastatvalue1 != "") { Inputs.var_netweight.Value = UDMethods.ConvertToDecimal((defaultintrastatvalue1)); }
            if (defaultintrastatvalue1 == "") { Inputs.var_netweight.Value = 1; }
        }
